import Patient_Entry from "./patient_display_item";
import classes from './admin_styles/patient_display_grid.module.css'


function Patient_display_grid({data}){
    return (
        <div className={classes.grid}>
            <ul>
                {data.map((post) => (
                    <Patient_Entry post={post.data}/>))}
            </ul>

        </div>

    )
}

export async function getServerSideProps() {
    // Fetch data from external API
    const res = await fetch(`http://localhost:8000/api/v1/registrations?page_id=1&page_size=1000`)
    const data = await res.json()

    // Pass data to the page via props
    return { props: { data } }
}
export default Patient_display_grid


